import { container } from "assets/jss/material-kit-react.jsx";

const PortofolioSectionStyle = theme => ({
	container: {
		...container
	},
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		justifyContent: 'space-around',
		overflow: 'hidden',
		backgroundColor: theme.palette.background.paper,
	},
	gridList: {
		width: "500px",
		height: "450px",
	},
})

export default PortofolioSectionStyle;
